window.bookSummaryJSON = "<p><b>Avery</b></p> <p>I fell into the clutches of those hunting me. Now, I’m enslaved in chains and at their mercy.</p> <p>But I’m not the woman I used to be. My weaknesses have been stripped away, unveiling a strength and defiance I never knew myself capable of. And I’ll be damned if I’m going down without a fight.</p> <p>Because my mate is coming for me.</p> <p>With him by my side, we will be unstoppable, and I am a storm cloud of rage ready to be unleashed.</p> <p><b>Wyatt</b></p> <p>I can’t think. Can't breathe. Can't exist…without her.</p> <p>I failed to protect Avery, and now she's imprisoned by them. Still, I won’t give up. I will bite and claw my way to her, and when I do, I will unleash my wolf on any who dared harm her.</p> <p>Because failure isn’t an option. Not when a realm is at stake and my mate’s life is on the line.</p> <p>I can only hope that I’m not too late.</p>"; 
